import React, { useState } from 'react';
import { Link, useHistory } from 'react-router-dom'; // Import useHistory
import axios from 'axios';

function Home({ adminData }) { // Make sure adminData is passed as props
  const [notificationMessage, setNotificationMessage] = useState('');
  const [menuOpen, setMenuOpen] = useState(false);
  const history = useHistory();

  const sendNotification = async () => {
    try {
      await axios.post('http://localhost:8000/api/notifications', { message: notificationMessage });
      console.log('Notification sent');
      setNotificationMessage('');
    } catch (error) {
      console.error('Error sending notification:', error);
    }
  };

  const handleMenuClick = () => {
    setMenuOpen(!menuOpen);
  };

  const handleEditProfileClick = () => {
    history.push('/edit-admin');
  };

  return (
    <div style={{ display: 'flex', minHeight: '100vh', backgroundColor: '#f0f0f0', color: '#000' }}>
      {/* Rest of the component */}
    </div>
  );
}

export default Home;
